// Wait for the document to be ready
$('document').ready(function() {
	var insertInto = $('#selectEntityBrushList');

	var allEnts = [];

	for(var entityType in window.entityTemplates) {
		allEnts.push(entityType);
	}

	allEnts.sort();

	for(var i=0; i<allEnts.length; ++i) {
		(function(templateName) {
			$('<li>')
				.appendTo(insertInto)
				.append(
					$('<div>', {
						text: templateName,
						class: 'btn btn-primary',
						click: function() {
							// Close the popup
							alertify.closeAll();

							// Set the active template
							window.setActiveTemplate(templateName);
						}
					})
				);
		})(allEnts[i]);
	}
});